  function submitForm(){
	var name = loginFrm.j_loginid.value;
	var pass = loginFrm.j_password.value;
	if($("#requestId").val()!=""){
		document.loginFrm.action='https://www.jointforce.com/oauth2/authorize';
	}else{
		document.loginFrm.action='https://www.jointforce.com/login';
	}
	if(name==null || name==""){
		//alert("帐号不能为空");
		//$("#errorbox")
		//$("#msg_id").html("帐号不能为空").show();
		$("#errorbox").slideDown(500,function(){
			$("#ksinput_j_password,#ksinput_j_loginid").remove();
			kS.setplaceholder("j_loginid");
			kS.setplaceholder("j_password");
			$("#ksinput_j_password,#ksinput_j_loginid").css("z-index","9999").css("width","238")
		});
		$("#errorbox span").attr("id","span-login").html("帐号不能为空");
		$("#j_loginid").focus();
		return false;
	}
	name =  name.replace(/\s+/g, "");

	if(pass==null || pass==""){
		//alert("密码不能为空");
		//$("#msg").html("密码不能为空").show();
		$("#errorbox").slideDown(500,function(){
			$("#ksinput_j_password,#ksinput_j_loginid").remove();
			kS.setplaceholder("j_loginid");
			kS.setplaceholder("j_password");
			$("#ksinput_j_password,#ksinput_j_loginid").css("z-index","9999").css("width","238")
		});
		$("#errorbox span").attr("id","span-password").html("密码不能为空");
		$("#j_password").focus();
		return false;
	}
	if(usedVerifyCode=="true"){
		var verifycode =loginFrm.verifyCode.value;
		if(verifycode==null || verifycode==""){
			//alert("验证码不能为空");
			$("#errorbox").slideDown(500);
			$("#errorbox span").attr("id","span-verify").html("验证码不能为空");
			return false;
		}
	}
	if(isChinese(name)){
		$("#errorbox").slideDown(500);
		$("#errorbox span").attr("id","span-verify").html("账号不存在，建议使用手机号登录");
		return false;
	}
	var pwdIsEncrypt="false";
	if("true"==pwdIsEncrypt){
		pass=new Base64().encode(pass);
	}
	loginFrm.j_password.value = pass;
	document.getElementById("j_loginid").value=name;
	document.getElementById("j_password").value=pass;
	setCookie("j_loginid",name);
   	document.loginFrm.submit();
   	$("#submit_button span.bold").html("登录中...");
   	$("#submit_button").removeAttr("onclick");
  }

  function canSubmit(){
		var name = loginFrm.j_loginid.value;
		var pass = loginFrm.j_password.value;
		if(name!="" && pass!=""){
			return true;
		}else{
			return false;
		}
  }

  function keyDownEvent(evt){    
        var e = evt;  
	    if(e.keyCode==13 && canSubmit()){
			submitForm('',false);

		}
  }

  function setCookie(name,value){
	  try{ 
	      var Days = 1000; 
	      var exp  = new Date();    //new Date("December 31, 9998");
	      exp.setTime(exp.getTime() + Days*24*60*60*1000);
	      document.cookie = name + "="+ escape (value) + ";expires=" + exp.toGMTString();
	  }catch(e){
	  }
  }

  function getCookie(name){//取cookies函数
      var arr = document.cookie.match(new RegExp("(^| )"+name+"=([^;]*)(;|$)"));
       if(arr != null) return unescape(arr[2]); return null;
  }

  function delCookie(name){//删除cookie
      var exp = new Date();
      exp.setTime(exp.getTime() - 1);
      var cval=getCookie(name);
      if(cval!=null) document.cookie= name + "="+cval+";expires="+exp.toGMTString();
  }

