$(function(){
    if($("#requestId").val()!=""){
    	$("#b-reg-login").show();
    	$("#loginbg").show();
    }
	if($("#errorbox span").html()!==""){
		$("#b-reg-login").show();
		$("#loginbg").show();
		$("#errorbox").show();
		if($("#errorbox span").attr("id")=="span-login"){
			$("#j_loginid").focus();
		}
		else if($("#errorbox span").attr("id")=="span-password"){
			$("#j_password").focus();
		}
		else if($("#errorbox span").attr("id")=="span-verify"){
			$("#j_password").focus();
		}
	}
	$("#j_loginid").keydown(function(e){
		if(e.keyCode == 9){
				if($(this).val()!==""){
					$(this).css("border-color","#ccc")
				}
				if($("#j_password").next().html()=="请输入密码"){
					$("#j_password").next().hide();
				}
		}
		var st = $("#j_loginid").next().html();
		if(st.indexOf("手机号")>-1){
			$("#j_loginid").next().hide();
		}
	})
	$("#j_password").keydown(function(e){
		if(e.keyCode == 9){
				if($(this).val()!==""){
					$(this).css("border-color","#ccc")
				}
		}
	})
	$(".reg").prev().css("clear","inherit");

