function getNewPutOrders(logintime){
	setInterval(
		function(){ 
			$.ajax({
				url: "/getneworders",
			    type: "POST",
			    dataType: "json",
			    data:logintime,
			    success:function(json){
				    var data = json.rows;
				    var _html = "";
				    for(var i=0;i<data.length;i++){
				    	_html += "
"+data[i].timeTip+"发布【"+data[i].tech_direction+"】";
					    _html += ""+data[i].onameTip+"";
					    _html += "￥";
						if(data[i].order_type=="4"){
							_html += "";
						}else{
							_html += "";
						}
					    _html += "";
					}
				    $("#blist ul").html();
				}
			});
	},1000*60*5);//每隔5分钟请求最新数据
}
function getNewBidOrders(logintime){
